import React from "react";
import {Card, CardBody} from "reactstrap"

function Header({name}){

    return(
        <Card className="my-2 bg-warning">
        <CardBody>
          <h1 className='text-center my-2'>Welcome</h1>
        </CardBody>
      </Card>
    );
}

export default Header;
